import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <form>
        Username: <input type="text" defaultValue="" />
      <br></br>
      Password: <input type="text" defaultValue="" />
      <br></br>
      <input type="submit" value="Submit"></input>
      </form>
    </div>
  );
}

export default App;
